import React, { Fragment } from "react";

import { Button, Grid } from "@material-ui/core/";

import "./index.scss";

export const RegisterStepLayout = (props) => (
  <div className="step-container">
    <Grid container component="main">
      <Grid item {...props.imageDimensions} className="image" />
      <Grid
        className="form-container box"
        item
        {...props.formDimensions}
        elevation={6}
        square
      >
        <Button variant="contained" className="logo">
          Logo
        </Button>
        {props.children}
      </Grid>
    </Grid>
  </div>
);

RegisterStepLayout.defaultProps = {
  imageDimensions: {
    xs: false,
    sm: 3,
    md: 3,
  },
  formDimensions: {
    xs: 12,
    sm: 9,
    md: 9,
  },
};
